          events: data.data
        });
        console.log(this.state.events[0]);
      })
      .catch(err => {
        console.log(err);
      });
  }
  render() {
    return (
      <div>
        <Navbar />
        Hello
      </div>
    );
  }
}

export default StudentViewAllEvents;
